import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Map from './Map';
import HeroSection from './HeroSection'; // Import the HeroSection component
import ServiceSection from './ServiceSection'; // Import the ServiceSection component
import AboutUs from './AboutUsSection'; // Import the AboutUs component
import BlogSection from './BlogSection'; // Import the BlogSection component
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSearch } from '@fortawesome/free-solid-svg-icons';
import './Home.css';

const Home = () => {
  const [properties, setProperties] = useState([]);
  const [search, setSearch] = useState('');
  const [region, setRegion] = useState('');
  const [county, setCounty] = useState('');
  const [subcounty, setSubcounty] = useState('');

  const countyData = {
    // Sample data structure for regions, counties, and sub-counties
    'Region 1': {
      'County 1': ['Subcounty 1', 'Subcounty 2'],
      'County 2': ['Subcounty 3', 'Subcounty 4'],
    },
    'Region 2': {
      'County 3': ['Subcounty 5', 'Subcounty 6'],
      'County 4': ['Subcounty 7', 'Subcounty 8'],
    },
  };

  const [regions, setRegions] = useState(Object.keys(countyData));
  const [counties, setCounties] = useState([]);
  const [subcounties, setSubcounties] = useState([]);

  // Function to fetch properties
  const fetchProperties = async () => {
    try {
      const response = await axios.get('/api/properties');
      setProperties(response.data);
    } catch (error) {
      console.error('Error fetching properties:', error);
    }
  };

  useEffect(() => {
    fetchProperties();
  }, []);

  const handleSearchClick = () => {
    // Implement the search functionality here
    console.log('Search clicked:', { region, county, subcounty });
  };

  const handleRegionChange = (e) => {
    const selectedRegion = e.target.value;
    setRegion(selectedRegion);
    setCounties(Object.keys(countyData[selectedRegion] || {}));
    setSubcounties([]);
    setCounty('');
    setSubcounty('');
  };

  const handleCountyChange = (e) => {
    const selectedCounty = e.target.value;
    setCounty(selectedCounty);
    setSubcounties(countyData[region][selectedCounty] || []);
    setSubcounty('');
  };

  return (
    <div className="home-container">
      {/* Search Section */}
      <div className="search-section">
        <div className="filters">
          <label htmlFor="region">Region:</label>
          <select id="region" value={region} onChange={handleRegionChange}>
            <option value="">Select Region</option>
            {regions.map((reg) => (
              <option key={reg} value={reg}>
                {reg}
              </option>
            ))}
          </select>

          {counties.length > 0 && (
            <>
              <label htmlFor="county">County:</label>
              <select id="county" value={county} onChange={handleCountyChange}>
                <option value="">Select County</option>
                {counties.map((cty) => (
                  <option key={cty} value={cty}>
                    {cty}
                  </option>
                ))}
              </select>
            </>
          )}

          {subcounties.length > 0 && (
            <>
              <label htmlFor="subcounty">Subcounty:</label>
              <select id="subcounty" value={subcounty} onChange={(e) => setSubcounty(e.target.value)}>
                <option value="">Select Subcounty</option>
                {subcounties.map((sub) => (
                  <option key={sub} value={sub}>
                    {sub}
                  </option>
                ))}
              </select>
            </>
          )}

          <button className="search-button" onClick={handleSearchClick}>
            <FontAwesomeIcon icon={faSearch} /> Search
          </button>
        </div>
      </div>

      {/* Map Section */}
      <div className="map-section">
        {properties.length > 0 ? (
          <Map properties={properties} />
        ) : (
          <p>No properties available. Please try a different search.</p>
        )}
      </div>

      {/* Hero Section */}
      <div className="hero-section-container">
        <HeroSection />
      </div>

      {/* Service Section */}
      <div className="service-section-container">
        <ServiceSection />
      </div>

      {/* About Us Section */}
      <div className="about-us-section-container">
        <AboutUs />
      </div>

      {/* Blog Section */}
      <div className="blog-section-container">
        <BlogSection />
      </div>
    </div>
  );
};

export default Home;
